import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Dashboard from "./pages/Dashboard";
import CategoryList from "./pages/CategoryList";
import ProductPage from "./pages/ProductPage";
import ProductDetails from "./pages/ProductDetails";
import SubcategoryPage from "./pages/SubcategoryPage"; 
import Orders from "./pages/Orders"; 
import OrderDetails from "./pages/OrderDetails";// Ensure correct import path
//import OrderDetails from "./components/OrderDetails";
import Profile from "./pages/Profile"  // ✅ Ensure this file exists
import { AuthProvider } from "./AuthProvider"; 

function App() {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* Main Routes */}
          <Route path="/" element={<Dashboard />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/Profile" element={<Profile />} /> 
          <Route path="/orders" element={<Orders />} />
          <Route path="/order-details/:orderId" element={<OrderDetails />} />

          {/* Category Routes */}
          <Route path="/CategoryList" element={<CategoryList />} />
          <Route path="/products/category/:categoryName" element={<CategoryList />} />
          
          {/* Product Routes */}
          <Route path="/products/:id" element={<ProductPage />} /> {/* Product Page by ID */}
          <Route path="/product/:id/details" element={<ProductDetails />} /> {/* Product Details by ID */}

          {/* Additional Routes (if any) */}
          <Route path="/subcategories/:categoryId" element={<SubcategoryPage />} />  {/* New route */}
        <Route path="/products/subcategory/:subcategoryId" element={<ProductPage />} />  {/* Product route for subcategory */}
  
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
